import App from '../../App.css'

export default class Card5 extends Component {
  render() {
    const design = {
        backgroundColor: "yellow"
    }
    return (
      <div style={design} onClick={this.props.remove}>
       {this.props.index}
<h1>Name: {this.props.Name}</h1>
<h1>Age: {this.props.Age}</h1>

      </div>
    )
  }
}
